import React from 'react'
import styled from 'styled-components'

const CardLi = styled.li`
  display: flex; /* 문자열이 이미지 옆으로 간다. */
  align-items: center;
  width: 100%;
  background-color: lightpink;
  border-radius: 1em;
  padding: 0.2em 0;
`

const AvatarImg = styled.img`
  border-radius: 50%;
  width: 10em;
  height: 10em;
  padding: 1em; /* 이미지 안쪽으로 패딩 주기 */
  margin-right: 1em;
`

function Card1210() {
  return (
    <CardLi>
      <AvatarImg src='images/default_logo.png' alt="이미지" />
      <div style={{ width: "100%" }}>info</div>
    </CardLi>
  )
}

export default Card1210
